import React, { Component } from 'react';
import { Rnd } from 'react-rnd';

const container = {
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  border: 'solid 1px rgb(211, 211, 211)',
  borderRadius: '5px',
  background: '#f0f0f0',
  minWidth: '200px',
  minHeight: '320px',
  margin: 0,
};

export default function Main() {
  return (
    <>
      <Rnd
        style={container}
        default={{
          x: 0,
          y: 0,
          width: 400,
          height: 640,
        }}
        minWidth={200}
        minHeight={400}
      >
        <div className="left">aaa</div>
        <div className="main">aaa</div>
      </Rnd>
    </>
  );
}
